import {Link} from 'react-router-dom';

const Navbar = () => {
    return ( 
        <nav className="navbar">
            <h1>ShopNow</h1>
            <div className="links">
                <Link to="/">Home</Link>
                <Link to="/">Add to cart</Link>
                <Link to="/login" style={{
                    color: "white",
                    backgroundColor: "#f1356d",
                    borderRadius: "8px"
                }}>Login</Link>
            </div>
        </nav>
    );
}
 
export default Navbar;
